import logo from "./logo.svg";
import "./App.css";
import UserProfile from "./components/userprofile/UserProfile";
import NewAppTest from "./components/test/NewApp";
import Parent from "./components/parent/ParentPage";

function App() {
  return (
    <div className="App">
      <UserProfile firstname="Sreyasi" lastname="Munshi" />
      <UserProfile firstname="Thaisa" />
      <UserProfile firstname="Leena" />
      <UserProfile firstname="Chia-Ching" />
      <UserProfile firstname="Tham" />
      <NewAppTest />
      <Parent />
    </div>
  );
}

export default App;
